package diameter.ro_r10_transatel;

import com.intellinet.diameter.*;


/**
 * WLAN-Session-Id AVP is of type Unsigned32 and contains the charging id generated by the AAA
 * server for the session.
 */
public class WLANSessionId extends com.intellinet.diameter.DerivedAVP<Integer> {
    /**
     * Constructs a WLANSessionId with the given value.
     *
     * @param value - the value of the AVP
     */
    public WLANSessionId(Integer value) {
        super(new com.intellinet.diameter.Unsigned32Data(value));
    }

    WLANSessionId(com.intellinet.diameter.Unsigned32Data data) {
        super(data);
    }
}
